/**
 * @param {string} s
 * @return {number}
 */
var numSub = function (s) {
  let count = 0;
  let mark = 0;
  for (var i = 0; i < s.length; i++) {
    if (s.charAt(i) == "0") continue;
    for (var j = i; j < s.length; j++) {
      if (s.charAt(j) == "0") {
        i = j;
        break;
      } else {
        mark++;
        if (j == s.length - 1) i = j;
      }
    }
    count += ((mark + 1) * mark) / 2;
    mark = 0;
  }
  return count;
};

console.log(
  numSub(
    ""
  )
);
